import React, { useState } from "react";
import {
  withGoogleMap,
  withScriptjs,
  GoogleMap,
  Marker,
  InfoWindow
} from "react-google-maps";
import * as locationsData from "./data/locations.json";

function Map() {
  const [selectedLoc, setSelectedLoc] = useState(null);
  return (
    <GoogleMap
      defaultZoom={10}
      defaultCenter={{ lat: 59.93848, lng: 30.312481 }}
    >
      {locationsData.features.map(loc => (
        <Marker
          key={loc.properties.LOC_ID}
          position={{
            lat: loc.geometry.coordinates[0],
            lng: loc.geometry.coordinates[1]
          }}
          onClick={() => {
            setSelectedLoc(loc);
          }}
        />
      ))}

      {selectedLoc && (
        <InfoWindow>
          <div> loc details</div>
        </InfoWindow>
      )}
    </GoogleMap>
  );
}

const WrappedMap = withScriptjs(withGoogleMap(Map));

export default function App() {
  return (
    <div style={{ width: "100vw", height: "100vh" }}>
      <WrappedMap
        googleMapURL={`https://maps.googleapis.com/maps/api/js?v=3.exp&libraries=geometry,drawing,places&key=AIzaSyCjbW172IDnWkymsN6374qVP1dSjn3azIE`}
        loadingElement={<div style={{ height: `100%` }} />}
        containerElement={<div style={{ height: `100%` }} />}
        mapElement={<div style={{ height: `100%` }} />}
      />
    </div>
  );
}
